import { chakra } from "@chakra-ui/react"

module.exports.SMButton = () => {
    return(
        <chakra.button
            sx={{
                shadow: "lg",
                rounded: "lg",
                bg: "white",
            }}
        >
            Click me
        </chakra.button>
    )
}
